import icon from './icon.jpg';

function navbar() {
    return (
        <nav className="navbar navbar-dark bg-dark">
            <div className="container-fluid">
                <img src={icon} width="30" height="24" className="p-3"/>
                <span className="navbar-brand">
                    Key Saver
                </span>
            </div>
        </nav>
    );
}

export default navbar;
